    - "<span class=\"Apple-style-span\" style=\"color: rgb(0, 0, 0); font-family: 'Times New Roman'; line-height: normal; font-size: medium;\"><p style=\"margin: 5px 2px 3px; padding: 0px; color: rgb(0, 0, 0); font-family: Calibri,'Trebuchet MS',Arial; font-size: medium; text-align: left;\">This profile test is a tool that will evaluate your current leadership strengths and growth areas according to 12 essential attributes. Six of these attributes are character based and the remaining six are learned skills. Our research indicates that together they combine to create a leadership portrait of what most people expect and desire from their leaders.</p><br style=\"margin: 0px; padding: 0px;\"><p class=\"ShortSentence\" style=\"margin: 5px 2px 3px; padding: 0px; color: rgb(0, 0, 0); font-family: Calibri,'Trebuchet MS',Arial; font-size: medium; text-align: center;\">&lt;b&gt;Check it out to see how you measure up!&lt;/b&gt;</p></span>"
    - "<h3 style=\"margin: 10px 0px; padding: 0px; font-family: Verdana; font-size: 14px; color: rgb(128, 32, 37); line-height: normal;\"><b>SUMMARY</b></h3><p style=\"margin: 5px 2px 3px; padding: 0px; color: rgb(0, 0, 0); font-family: Calibri,'Trebuchet MS',Arial; font-size: medium; text-align: left; line-height: normal;\">This profile test is a tool that will evaluate your current leadership strengths and growth areas according to 12 essential leadership attributes. 6 of these attributes are character based and the remaining 6 are learned skills. Our research indicates that they combine to create a portrait of what most people both expect and desire from their leaders.</p><span class=\"Apple-style-span\" style=\"color: rgb(0, 0, 0); font-family: 'Times New Roman'; line-height: normal; font-size: medium;\"><br style=\"margin: 0px; padding: 0px;\"></span><p style=\"margin: 5px 2px 3px; padding: 0px; color: rgb(0, 0, 0); font-family: Calibri,'Trebuchet MS',Arial; font-size: medium; text-align: left; line-height: normal;\">This assessment was specifically designed for 14-25 year old Christian leaders, however we have received positive feedback from participants of all ages!</p><span class=\"Apple-style-span\" style=\"color: rgb(0, 0, 0); font-family: 'Times New Roman'; line-height: normal; font-size: medium;\"><br style=\"margin: 0px; padding: 0px;\"></span><p style=\"margin: 5px 2px 3px; padding: 0px; color: rgb(0, 0, 0); font-family: Calibri,'Trebuchet MS',Arial; font-size: medium; text-align: left; line-height: normal;\">This assessment has four components:</p><div class=\"BulletPoint\" style=\"margin: 0px; padding: 0px 0px 0px 50px; color: rgb(0, 0, 0); font-family: 'Times New Roman'; line-height: normal; font-size: medium;\"><ol style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Calibri,'Trebuchet MS',Arial; font-size: medium;\"><li style=\"margin: 0px; padding: 0px;\">Completion of the Self Test</li><li style=\"margin: 0px; padding: 0px;\">Completion of Feedback Tests (we recommend three)</li><li style=\"margin: 0px; padding: 0px;\">View Scores (automatically calculated for you)</li><li style=\"margin: 0px; padding: 0px;\">Work through the Analysis and Growth Plan with a trusted coach or mentor</li></ol></div><h3 style=\"margin: 10px 0px; padding: 0px; font-family: Verdana; font-size: 14px; color: rgb(128, 32, 37); line-height: normal;\"><b>INSTRUCTIONS</b></h3><div class=\"BulletPoint\" style=\"margin: 0px; padding: 0px 0px 0px 50px; color: rgb(0, 0, 0); font-family: 'Times New Roman'; line-height: normal; font-size: medium;\"><ol style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Calibri,'Trebuchet MS',Arial; font-size: medium;\"><li style=\"margin: 0px; padding: 0px;\">Click on&nbsp;<strong style=\"margin: 0px; padding: 0px;\">Create New Assessment</strong>&nbsp;to create a new assessment and complete your Self Test. This part of the assessment is available to you free of charge.</li><li style=\"margin: 0px; padding: 0px;\">Click on the newly created Assessment below to go to its&nbsp;<strong style=\"margin: 0px; padding: 0px;\">Summary Page</strong>.</li><li style=\"margin: 0px; padding: 0px;\">Take some time to choose at least three individuals that know you well and will provide you with honest, accurate feedback. It recommended that you choose a supervisor (such as a coach, employer, parent or teacher), a co-worker (such as a teammate or someone that you have worked with before) and a close friend. These individuals will become your Feedback Team in order to enhance the accuracy of this assessment. Click on&nbsp;<strong style=\"margin: 0px; padding: 0px;\">Add New Team Member</strong>&nbsp;in the Summary page to enter their name and email address to automatically invite them to complete the Feedback Test on your behalf.</li><li style=\"margin: 0px; padding: 0px;\">View your Scores and then click on Analysis. With a coach or guide, follow the suggestions there in order to best understand your current leadership profile and design an individual Growth Plan to allow you to stretch and increase your leadership capacity. Don\xE2\x80\x99t forget that you can further enhance the Growth Plan by making use of the other assessments available on this site!</li></ol></div>"
    - "<ul style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Calibri,'Trebuchet MS',Arial; font-size: medium; line-height: normal;\"><li style=\"margin: 0px; padding: 0px;\"><h3 style=\"margin: 10px 0px; padding: 0px; font-family: Verdana; font-size: 14px; color: rgb(128, 32, 37);\"><b>Self-Test Instructions</b></h3><div class=\"BulletPoint\" style=\"margin: 0px; padding: 0px 0px 0px 50px; font-family: 'Times New Roman'; font-size: medium;\"><ul style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Calibri,'Trebuchet MS',Arial; font-size: medium;\"><li style=\"margin: 0px; padding: 0px;\">You will need approximately 15 minutes to complete this assessment.</li><li style=\"margin: 0px; padding: 0px;\">Read each statement carefully and be as honest as possible!</li><li style=\"margin: 0px; padding: 0px;\">Score yourself based on actual observed behaviours,&nbsp;<strong style=\"margin: 0px; padding: 0px;\">not</strong>&nbsp;what you think you&nbsp;<strong style=\"margin: 0px; padding: 0px;\">should</strong>&nbsp;do or would&nbsp;<strong style=\"margin: 0px; padding: 0px;\">desire</strong>&nbsp;to do.</li><li style=\"margin: 0px; padding: 0px;\">Score each question from 1 (completely false) to 10 (completely true).</li><li style=\"margin: 0px; padding: 0px;\">Don\xE2\x80\x99t leave any questions blank!</li><li style=\"margin: 0px; padding: 0px;\">Click&nbsp;<strong style=\"margin: 0px; padding: 0px;\">Submit</strong>&nbsp;when you have completed the assessment. Note that your responses are automatically saved as you move along, in case you need to exit and return to the test at a later time.</li></ul></div></li></ul>"
    - "<span class=\"Apple-style-span\" style=\"color: rgb(0, 0, 0); font-family: Calibri,'Trebuchet MS',Arial; font-size: 16px; line-height: normal;\"><h3 style=\"border-width: 0px; margin: 10px 0px; padding: 0px; font-weight: normal; font-style: inherit; font-size: 14px; font-family: Verdana; vertical-align: baseline; color: rgb(128, 32, 37); line-height: 1;\"><b><p style=\"margin: 5px 2px 3px; padding: 0px; color: rgb(0, 0, 0); font-family: Calibri,'Trebuchet MS',Arial; font-size: medium; text-align: left; font-weight: normal; line-height: normal;\">Welcome to LAUNCH Tools. We appreciate you taking the time to fill out this leadership feedback assessment on behalf of Suraj.</p><span class=\"Apple-style-span\" style=\"color: rgb(0, 0, 0); font-family: 'Times New Roman'; font-weight: normal; line-height: normal; font-size: medium;\"><br style=\"margin: 0px; padding: 0px;\"></span><h3 style=\"margin: 10px 0px; padding: 0px; font-family: Verdana; font-size: 14px; color: rgb(128, 32, 37); line-height: normal;\"><b>Instructions:</b></h3><div class=\"BulletPoint\" style=\"margin: 0px; padding: 0px 0px 0px 50px; color: rgb(0, 0, 0); font-family: 'Times New Roman'; font-weight: normal; line-height: normal; font-size: medium;\"><ul style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Calibri,'Trebuchet MS',Arial; font-size: medium;\"><li style=\"margin: 0px; padding: 0px;\">You will need approximately 10 minutes to complete this assessment.</li><li style=\"margin: 0px; padding: 0px;\">Read each statement carefully.</li><li style=\"margin: 0px; padding: 0px;\">Please be as honest as possible to make this the best possible growth experience for Suraj. Your feedback will remain anonymous and we have strongly encouraged Suraj to process the results of this feedback with a supportive coach.</li><li style=\"margin: 0px; padding: 0px;\">Score Suraj based on actual observed behaviours,&nbsp;<strong style=\"margin: 0px; padding: 0px;\">not</strong>&nbsp;what you think Suraj&nbsp;<strong style=\"margin: 0px; padding: 0px;\">should</strong>&nbsp;do or would&nbsp;<strong style=\"margin: 0px; padding: 0px;\">desire</strong>&nbsp;to do.</li><li style=\"margin: 0px; padding: 0px;\">Score each question from 1 (completely false) to 10 (completely true).</li><li style=\"margin: 0px; padding: 0px;\">If you have never had the opportunity to observe, you may score a question N/A. Please use this option as a last resort only!</li><li style=\"margin: 0px; padding: 0px;\">Click&nbsp;<strong style=\"margin: 0px; padding: 0px;\">Submit</strong>&nbsp;when you have completed the assessment. Note that your responses are automatically saved as you move along, in case you need to exit and return to the test at a later time.</li></ul></div></b></h3></span>"
