align: baseline;\">Each question has multiple option. Pick the best or most correct option or options you would do<br></li><li style=\"border-width: 0px; margin: 0px; padding: 0px; font-weight: inherit; font-style: inherit; font-size: 16px; font-family: inherit; vertical-align: baseline;\">Don\xE2\x80\x99t leave any questions blank!</li><li style=\"border-width: 0px; margin: 0px; padding: 0px; font-weight: inherit; font-style: inherit; font-size: 16px; font-family: inherit; vertical-align: baseline;\">Click&nbsp;<strong style=\"margin: 0px; padding: 0px; font-weight: bold;\">Submit</strong>&nbsp;when you have completed the assessment. Note that your responses are automatically saved as you move along, in case you need to exit and return to the test at a later time.</li></ul></div></span>"
